problem:
In the diagram below, we have $AB = 24$ and $\angle ADB =90^\circ$.  If $\sin A = \frac23$ and $\sin C = \frac34$, then what is $BC$?


[asy]
pair A,B,C,D;
A = (0,0);
B = (8*sqrt(5),16);
D = (8*sqrt(5),0);
C = (8*sqrt(5) + 5.3333*sqrt(7),0);
draw(D--B--A--C--B);
label("$A$",A,SW);
label("$B$",B,N);
label("$C$",C,SE);
label("$D$",D,S);
draw(rightanglemark(B,D,A,43));
