solution:
We use the distance formula:  \begin{align*}
\sqrt{(2 - (-4))^2 + ((-6) - 3)^2} &= \sqrt{6^2 + (-9)^2}\\
& = \sqrt{36 + 81}\\
& = \sqrt{117} = \boxed{3\sqrt{13}}.
\end{align*}

We follow the order of operations:  \begin{align*}
92 - 45 \div (3\times 5) - 5^2 &= 92 - 45 \div 15 - 5^2 \\
&= 92 - 45\div 15 -25 \\
&= 92 - 3 - 25=89-25 = \boxed{64}.
\end{align*}

Let $O$ be the origin.  Then we can express the area of triangle $ABC$ as
\[[ABC] = [ABO] + [BCO] - [ACO].\][asy]
unitsize(1.5 cm);

pair A, B, C, O;

A = 2*dir(70);
B = 2*sqrt(3)*dir(40);
C = 3*dir(10);

draw(A--B--C--cycle);
draw(A--O);
draw(B--O);
draw(C--O);
draw((-0.5,0)--(3,0));
draw((0,-0.5)--(0,2.5));

label("$A$", A, NW);
label("$B$", B, NE);
label("$C$", C, E);
label("$O$", O, SW);
[/asy]

We have that
\begin{align*}
[ABO] &= \frac{1}{2} AO \cdot BO \sin \angle AOB = \frac{1}{2} \cdot 2 \cdot 2 \sqrt{3} \sin 30^\circ = \sqrt{3}, \\
[BCO] &= \frac{1}{2} BO \cdot CO \sin \angle BOC = \frac{1}{2} \cdot 2 \sqrt{3} \cdot 3 \sin 30^\circ = \frac{3 \sqrt{3}}{2}, \\
[ACO] &= \frac{1}{2} AO \cdot CO \sin \angle AOC = \frac{1}{2} \cdot 2 \cdot 3 \sin 60^\circ = \frac{3 \sqrt{3}}{2}.
\end{align*}Therefore,
\[[ABC] = [ABO] + [BCO] - [ACO] = \boxed{\sqrt{3}}.\]

