Triangle $POD$ is a 30-60-90 triangle, so $DO = \frac{\sqrt{3}}{2}$ and $PD = \frac{1}{2}$.  Therefore, the coordinates of $P$ are $\left(\frac{\sqrt{3}}{2},-\frac{1}{2}\right)$, so $\sin330^\circ = \boxed{-\frac{1}{2}}$.

problem:
In the figure, square $WXYZ$ has a diagonal of 12 units. Point $A$ is a midpoint of segment $WX$, segment $AB$ is perpendicular to segment $AC$ and $AB = AC.$ What is the length of segment $BC$? [asy]
import olympiad; size(150); defaultpen(linewidth(0.8));

draw(unitsquare);
draw((2,0)--(0.5,0)--(0.5,1.5)--cycle);
label("$W$",(0,0),W); label("$X$",(1,0),S); label("$Y$",(1,1),E); label("$Z$",(0,1),W);
label("$A$",(0.5,0),S); label("$B$",(2,0),E); label("$C$",(0.5,1.5),N);
[/asy]

solution:
Triangles WXY and BXY are isosceles triangles that have a leg in common, so they are congruent.  Therefore segment $YB$ is equal to a diagonal of square $WXYZ$, so its length is 12 units. By adding point $D$, as shown, we can see that triangles $CDY$ and $YXB$ are similar to triangle $CAB$. This also means that triangle $CDY$ is similar to triangle $YXB$. Since the sides of two similar triangles are related by a constant factor, and we can see that the length of $DY$ is 1/2 the length of $XB$, we know that the length of $CY$ must be $(1/2)(12) = 6$ units. Thus, the length of CB is $12 + 6 = \boxed{18\text{ units}}$. [asy]
import olympiad; size(150); defaultpen(linewidth(0.8));
draw(unitsquare);
draw((2,0)--(0.5,0)--(0.5,1.5)--cycle);
label("$W$",(0,0),W); label("$X$",(1,0),S); label("$Y$",(1,1),E); label("$Z$",(0,1),W);
label("$A$",(0.5,0),S); label("$B$",(2,0),E); label("$C$",(0.5,1.5),N);
label("$D$",(0.5,1),NW);
[/asy]

To find the sum, we look at the first few powers of 2 modulo 7: \begin{align*}
2^0 &\equiv 1, \\
2^1 &\equiv 2, \\
2^2 &\equiv 4, \\
2^3 &\equiv 8 \equiv 1 \pmod{7}
\end{align*}Since $2^3 \equiv 1 \pmod{7}$, the powers of 2 modulo 7 repeat in cycles of 3.  Therefore, \begin{align*}
&1 + 2 + 2^2 + 2^3 + \dots + 2^{100} \\
&\quad\equiv 1 + 2 + 4 + 1 + 2 + 4 + \dots + 1 + 2 + 4 + 1 + 2 \\
&\quad\equiv (1 + 2 + 4) + (1 + 2 + 4) + \dots + (1 + 2 + 4) + 1 + 2 \\
&\quad\equiv \boxed{3} \pmod{7}.
\end{align*}

First of all, a sketch might be useful. Since we have an isosceles triangle on our hands, let's drop a median/altitude/bisector from $B$ as well: [asy]
pair pA, pB, pC, pD, pE;
pA = (-2, 0);
pB = (0, 4.5826);
pC = (2, 0);
pD = (pB * 4 + pC * 5) / (9);
pE = (0, 0);
draw(pA--pB--pC--pA);
draw(pA--pD);
draw(pB--pE);
label("$A$", pA, SW);
label("$B$", pB, N);
label("$C$", pC, SE);
label("$D$", pD, NE);
label("$E$", pE, S);
draw(rightanglemark(pB,pE,pA,7));
[/asy] We might be able to create some usable right triangles if we draw a perpendicular segment from $D$ to $AC$: [asy]
pair pA, pB, pC, pD, pE, pF;
pA = (-2, 0);
pB = (0, 4.5826);
pC = (2, 0);
pD = (pB * 4 + pC * 5) / (9);
pE = (0, 0);
pF = (pE * 4 + pC * 5) / (9);
draw(pA--pB--pC--pA);
draw(pA--pD);
draw(pB--pE);
draw(pD--pF);
label("$A$", pA, SW);
label("$B$", pB, N);
label("$C$", pC, SE);
label("$D$", pD, NE);
label("$E$", pE, S);
label("$F$", pF, S);
draw(rightanglemark(pB,pE,pA,7));
draw(rightanglemark(pD,pF,pA,7));
[/asy] Thanks to $AA$ similarity, we see that $\triangle DFC \sim \triangle BEC.$ We see that $CD:CB = DF:BE = CF:CE.$ As for $CD:CB,$ we know that $CD:DB = 4:5$ by the Angle Bisector Theorem. Since $CB = CD + DB,$ it follows that $CD:CB = DF:BE = CF:CE = 4:9.$ That means $DF = BE \cdot \left(\frac{4}{9}\right),$ and $CF = CE \cdot \left(\frac{4}{9}\right).$

Since $CE$ is half of $AC,$ we have that $CE = 2$ and $CF = \frac{8}{9}.$ Then, $AF = AC - FC = 4 - \frac{8}{9} = \frac{28}{9}.$

We apply the Pythagorean Theorem to find that $AD^2 = DF^2 + AF^2.$ We just found $AF,$ and as for $DF,$ we have $DF = BE \cdot \left(\frac{4}{9}\right).$ Squaring both sides, we have $DF^2 = BE^2 \cdot \left(\frac{16}{81}\right).$ We know that $BE^2 = BC^2 - CE^2 = 5^2 - 2^2 = 21.$ Therefore, $DF^2 = 21 \cdot \left(\frac{16}{81}\right).$

Going back to the expression for $AD^2,$ we now have \begin{align*}
AD^2 &= DF^2 + AF^2 \\
&= 21 \cdot \left(\frac{16}{81}\right) + \left(\frac{28}{9}\right)^2\\
&= \frac{336}{81} + \frac{784}{81} = \boxed{\frac{1120}{81}}.
\end{align*}

First we add the two fractions: \begin{align*}
\frac{2}{1 + 2\sqrt{3}} + \frac{3}{2 - \sqrt{3}} & = \frac{2(2-\sqrt{3}) + 3(1 + 2\sqrt{3})}{(1+ 2\sqrt{3})(2 - \sqrt{3})} \\
& = \frac{4\sqrt{3} + 7}{3\sqrt{3}-4}
\end{align*}Now we rationalize the denominator to get the result in the desired form: \begin{align*}
\frac{4\sqrt{3} + 7}{3\sqrt{3}-4} & = \frac{4\sqrt{3} + 7}{3\sqrt{3}-4} \cdot \frac{3\sqrt{3}+4}{3\sqrt{3}+4} \\
& = \frac{(4\sqrt{3} + 7)(3\sqrt{3}+4)}{3^2(3) - 4^2} \\
& = \frac{64 + 37\sqrt{3}}{11}.
\end{align*}This gives $A = 64$, $B = 37$, and $C = 11$, so $A+B+C = \boxed{112}$.

