Three noncollinear points in the coordinate plane determine a quadratic polynomial in $x$ unless two of the points have the same $x$-coordinate. Therefore, given the direction of the directrix, three noncollinear points determine a parabola, unless two of the points lie on a line perpendicular to the directrix. This case is ruled out by the given condition, so the answer is $\boxed{1}$.

We substitute these two points into the given equation to solve for $c$. Plugging in $(2,3)$, we get $3=2^2+2b+c\Rightarrow 2b+c=-1$. Plugging in $(4,3)$, we get $3=4^2+4b+c \Rightarrow 4b+c=-13$. In summary, we have the two equations \begin{align*}
2b+c&=-1\\
4b+c&=-13
\end{align*} Multiplying the first equation by 2, we have $4b+2c=-2$. Subtracting the second equation from this last one, we have $(4b+2c)-(4b+c)=-2-(-13) \Rightarrow c=\boxed{11}$.

