We plot $r = 1 + \cos \theta.$  If we rotate it around the point $(2,0),$ then the curve sweeps out a circle of radius $R,$ where $R$ is the maximum distance between a point on the curve and the point $(2,0).$

[asy]
unitsize(1 cm);

pair moo (real t) {
  real r = 1 + cos(t);
  return (r*cos(t), r*sin(t));
}

path foo = moo(0);
real t;

for (t = 0; t <= 2*pi + 0.1; t = t + 0.1) {
  foo = foo--moo(t);
}

filldraw(Circle((2,0),4/sqrt(3)),gray(0.9),gray(0.9));
draw(foo);

dot((2,0), red);
label("$(2,0)$", (2,0), E);
[/asy]

For the curve $r = 1 + \cos \theta,$
\begin{align*}
x &= r \cos \theta = (1 + \cos \theta) \cos \theta, \\
y &= r \sin \theta = (1 + \cos \theta) \sin \theta,
\end{align*}so if $d$ is the distance between $(x,y)$ and $(2,0),$ then
\begin{align*}
d^2 &= ((1 + \cos \theta) \cos \theta - 2)^2 + ((1 + \cos \theta) \sin \theta)^2 \\
&= (\cos^2 \theta + \cos \theta - 2)^2 + (1 + \cos \theta)^2 \sin^2 \theta \\
&= (\cos^2 \theta + \cos \theta - 2)^2 + (1 + \cos \theta)^2 (1 - \cos^2 \theta) \\
&= (\cos^4 \theta + 2 \cos^3 \theta - 3 \cos^2 \theta - 4 \cos \theta + 4) + (-\cos^4 \theta - 2 \cos^3 \theta + 2 \cos \theta + 1) \\
&= -3 \cos^2 \theta - 2 \cos \theta + 5 \\
&= -3 \left( \cos \theta + \frac{1}{3} \right)^2 + \frac{16}{3}.
\end{align*}The maximum value of $d^2$ is then $\frac{16}{3},$ which occurs when $\cos \theta = -\frac{1}{3}.$

Therefore, the area that the curve sweeps out is $\boxed{\frac{16 \pi}{3}}.$

problem:
Five points $A$, $B$, $C$, $D$, and $O$ lie on a flat field.  $A$ is directly north of $O$, $B$ is directly west of $O$, $C$ is directly south of $O$, and $D$ is directly east of $O$. The  distance between $C$ and $D$ is 140 m.  A hot-air balloon is positioned in the air at $H$ directly above $O$. The balloon is held in place by four ropes $HA$, $HB$, $HC$, and $HD$.  Rope $HC$ has length 150 m and rope $HD$ has length 130 m. [asy]
size(250);
pair A, B, C, D, O, H, W, X, Y, Z;
O=(0,0);
A=(1,1);
D=(1.5,-.3);
B=(-1.5,.3);
C=(-1,-1);
H=(0,2.5);
W=(5/3)*(A+D);
X=(5/3)*(A+B);
Y=(-1)*(W);
Z=(-1)*(X);
draw(W--X--Y--Z--W);
draw(A--C);
draw(B--D);
draw(O--H, linewidth(1));
draw(A--H, dashed);
draw(B--H, dashed);
draw(C--H, dashed);
draw(D--H, dashed);
dot(A);
dot(B);
dot(C);
dot(D);
dot(O);
dot(H);
label("A", A, NE);
label("B", B, SW);
label("C", C, SE);
label("D", D, NE);
label("O", O, SE);
label("H", H, NW);
[/asy]

To reduce the total length of rope used, rope $HC$ and rope $HD$ are to be replaced by a single rope $HP$ where $P$ is a point on the straight line between $C$ and $D$. (The balloon remains at the same position $H$ above $O$ as described above.)  Determine the greatest length of rope that can be saved.

solution:
To save the most rope, we must have $HP$ having minimum length.
For $HP$ to have minimum length, $HP$ must be perpendicular to $CD$. [asy]
pair C, D, H, P;
H=(90,120);
C=(0,0);
D=(140,0);
P=(90,0);
draw(H--C--D--H--P);
label("H", H, N);
label("C", C, SW);
label("D", D, SE);
label("P", P, S);
label("150", (C+H)/2, NW);
label("130", (D+H)/2, NE);
[/asy] (Among other things, we can see from this diagram that sliding $P$ away from the perpendicular position does make $HP$ longer.)
In the diagram, $HC=150$, $HD=130$ and $CD=140$.
Let $HP=x$ and $PD=a$.  Then $CP=140-a$.
By the Pythagorean Theorem in $\triangle HPC$, $x^2 + (140-a)^2 = 150^2$.
By the Pythagorean Theorem in $\triangle HPD$, $x^2+a^2 = 130^2$.
Subtracting the second equation from the first, we obtain \begin{align*}
(140-a)^2 - a^2 & = 150^2 - 130^2 \\
(19600 - 280a+a^2)-a^2 & = 5600 \\
19600 -280a & = 5600 \\
280a & = 14000 \\
a & = 50
\end{align*} Therefore, $x^2 + 90^2 = 150^2$ or $x^2 = 150^2 - 90^2 = 22500 - 8100 = 14400$ so $x =120$.
So the shortest possible rope that we can use is 120 m, which saves $130+150-120 = \boxed{160}$ m of rope.

Let $A,B,C,$ and $D$ be the corners of a regular tetrahedron of side length $1$. Let $P$ be the foot of the perpendicular from $D$ to face $ABC$, and let $h$ be the height $DP$: [asy]
import three;
triple a = (0,0,0);
triple b = (1,0,0);
triple c = (1/2,sqrt(3)/2,0);
triple d = (1/2,sqrt(3)/6,sqrt(6)/3);
triple p = (a+b+c)/3;

draw(surface(a--b--c--cycle),pink,nolight);
draw(b--c--d--b);
draw(c--a--b,dashed); draw(a--d--p--b,dashed);
draw(p+(d-p)*0.08--p+(d-p)*0.08+(b-p)*sqrt(2)*0.08--p+(b-p)*sqrt(2)*0.08);
dot(a); dot(b); dot(c); dot(d); dot(p);
label("$A$",a,ENE);
label("$B$",b,WSW);
label("$C$",c,ESE);
label("$D$",d,N);
label("$P$",p,E);
label("$h$",0.45*d+0.55*p,W);
[/asy] Then, by the Pythagorean theorem, we have $$h^2+(PA)^2 = h^2+(PB)^2 = h^2+(PC)^2 = 1,$$so $PA=PB=PC$. The only point on face $ABC$ that is equidistant from $A,B,$ and $C$ is the intersection of the altitudes. If $M$ is the midpoint of $AC$, then $\triangle CPM$ is a $30^\circ$-$60^\circ$-$90^\circ$ triangle with $CM=\frac 12$, so $PC=\frac 2{\sqrt 3}\cdot\frac 12=\frac 1{\sqrt 3}$.

Therefore, $$h=\sqrt{1-(PC)^2} = \sqrt{1-\left(\frac 1{\sqrt 3}\right)^2} = \sqrt{1-\frac 13} = \sqrt{\frac 23} = \frac{\sqrt 2}{\sqrt 3},$$and the volume of tetrahedron $ABCD$ is \begin{align*}
V &= \frac 13\cdot(\text{area of }\triangle ABC)\cdot h \\
&= \frac 13\cdot\left(\frac 12\cdot 1\cdot \frac{\sqrt 3}2\right)\cdot \frac{\sqrt 2}{\sqrt 3} \\
&= \frac{\sqrt 2}{12};
\end{align*}the square of the volume is $$V^2 = \left(\frac{\sqrt 2}{12}\right)^2 = \frac{2}{144} = \boxed{\frac 1{72}}.$$

