A = dir(100);
B = dir(200);
C = dir(340);
O = (0,0);

draw(Circle(O,1));
draw(A--B--C--cycle);
draw(O--A,Arrow(6));
draw(O--B,Arrow(6));
draw(O--C,Arrow(6));

