Since $AC = 5,$ $AC^2 = 25.$  But
\begin{align*}
AC^2 &= \|\mathbf{c} - \mathbf{a}\|^2 \\
&= (\mathbf{c} - \mathbf{a}) \cdot (\mathbf{c} - \mathbf{a}) \\
&= \|\mathbf{c}\|^2 - 2 \mathbf{a} \cdot \mathbf{c} + \|\mathbf{a}\|^2 \\
&= 2R^2 - 2 \mathbf{a} \cdot \mathbf{c},
\end{align*}where $R$ is the circumradius.  Hence,
\[\mathbf{a} \cdot \mathbf{c} = R^2 - \frac{AC^2}{2}.\]Similarly, we can prove that
\[\mathbf{a} \cdot \mathbf{b} = R^2 - \frac{AB^2}{2}.\]Therefore,
\[\mathbf{a} \cdot \mathbf{c} - \mathbf{a} \cdot \mathbf{b} = \left( R^2 - \frac{AC^2}{2} \right) - \left( R^2 - \frac{AB^2}{2} \right) = \frac{AB^2 - AC^2}{2} = \frac{3^2 - 5^2}{2} = \boxed{-8}.\]

problem:
What is the number of square centimeters in the shaded area? (The 10 represents the hypotenuse of the white triangle only.) [asy]
fill((6,0)--(9,0)--(9,12)--(6,8)--cycle,gray(0.7));
draw((0,0)--(9,0)--(9,12)--cycle,linewidth(0.7));
draw((6,8)--(6,0),linewidth(0.7));
draw((5.6,0)--(5.6,0.4)--(6,0.4));
draw((8.6,0)--(8.6,0.4)--(9,0.4));
label("6",(3,0),S);
label("10",(3,4),NW);
label("3",(7.5,0),S);
[/asy]

solution:
We start by labeling everything first: [asy]
fill((6,0)--(9,0)--(9,12)--(6,8)--cycle,gray(0.7));
draw((0,0)--(9,0)--(9,12)--cycle,linewidth(0.7));
draw((6,8)--(6,0),linewidth(0.7));
draw((5.6,0)--(5.6,0.4)--(6,0.4));
draw((8.6,0)--(8.6,0.4)--(9,0.4));
label("6",(3,0),S);
label("10",(3,4),NW);
label("3",(7.5,0),S);
label("A",(0,0),SW);
label("B",(9,0),SE);
label("C",(9,12),NW);
label("D",(6,0),S);
label("E",(6,8),NW);
[/asy] First of all, we can see that $DE = 8$ since we recognize a $3:4:5$ triangle in $ADE$. Also, thanks to SAS Similarity (or AA also works), we see that $\triangle ABC \sim \triangle ADE.$ That means that $ABC$ is also a $3:4:5$ triangle. Since $AB = 9,$ that means that $AC = 15$ and $BC = 12.$

We find the shaded area of $BCED$ by subtracting the areas of $ABC$ and $ADE.$ The area of $ABC$ is simply $\dfrac{9 \cdot 12}{2} = 54,$ and the area of $ADE$ is $\dfrac{6 \cdot 8}{2} = 24.$ Therefore, our desired area is $54 - 24 = \boxed{30} \text{ cm}^2.$

