problem:
For $x \ge 1,$ let $f$ be the function defined as follows:
\[f(x) = \left\{
\begin{array}{cl}
\lfloor x \rfloor \left| x - \lfloor x \rfloor - \dfrac{1}{2 \lfloor x \rfloor} \right| & \text{if $x < \lfloor x \rfloor + \dfrac{1}{\lfloor x \rfloor}$}, \\
f \left( x - \dfrac{1}{\lfloor x \rfloor} \right) & \text{otherwise}.
\end{array}
\right.\]Let $g(x) = 2^{x - 2007}.$ Compute the number of points in which the graphs of $f$ and $g$ intersect.

solution:
Let $n$ be an integer, and let $n \le x < n + \frac{1}{n}.$  Then
\[f(x) = n \left| x - n - \frac{1}{2n} \right|.\]This portion of the graph is shown below.

[asy]
unitsize(1.5 cm);

draw((-1,0)--(-1,3.2));
draw((-1,0)--(-2/3,0));
draw((-1/3,0)--(2 + 0.2,0));
draw((-1.1,3)--(-0.9,3));
draw((0,-0.1)--(0,0.1));
draw((1,-0.1)--(1,0.1));
draw((2,-0.1)--(2,0.1));
draw((0,3)--(1,0)--(2,3));

label("$\frac{1}{2}$", (-1.1,3), W);
label("$n$", (0,-0.1), S);
label("$n + \frac{1}{2n}$", (1,-0.1), S);
label("$n + \frac{1}{n}$", (2,-0.1), S);
[/asy]

Then for $n + \frac{1}{n} < x < n + 1,$
\[f(x) = f \left( x - \frac{1}{n} \right),\]so the portion of the graph for $n \le x < n + \frac{1}{n}$ repeats:

[asy]
unitsize(1.5 cm);

draw((-0.2,0)--(4 + 0.2,0));
draw((5.8,0)--(8.2,0));
draw((0,-0.1)--(0,0.1));
draw((2,-0.1)--(2,0.1));
draw((4,-0.1)--(4,0.1));
draw((6,-0.1)--(6,0.1));
draw((8,-0.1)--(8,0.1));
draw((0,3)--(1,0)--(2,3)--(3,0)--(4,3));
draw((6,3)--(7,0)--(8,3));

label("$n$", (0,-0.1), S);
label("$n + \frac{1}{n}$", (2,-0.1), S);
label("$n + \frac{2}{n}$", (4,-0.1), S);
label("$n + \frac{n - 1}{n}$", (6,-0.1), S);
label("$n + 1$", (8,-0.1), S);
label("$\dots$", (5,0));
[/asy]

Note that $g(2006) = \frac{1}{2},$ so $x = 2006$ is the largest $x$ for which the two graphs intersect.  Furthermore, for $1 \le n \le 2005,$ on the interval $[n, n + 1),$ the graph of $g(x) = 2^x$ intersects the graph of $f(x)$ twice on each subinterval of length $\frac{1}{n},$ so the total number of intersection points is
\[2 \cdot 1 + 2 \cdot 2 + \dots + 2 \cdot 2005 = 2005 \cdot 2006 = \boxed{4022030}.\]

Let $P$ be the point lying on the sphere, so $P = (41,29,50).$

[asy]
import three;

size(180);
currentprojection = perspective(6,3,2);

triple I = (1,0,0), J = (0,1,0), K = (0,0,1), O = (0,0,0), P = (2,1.5,1);

draw(surface((0,0,0)--(0,2.5,0)--(0,2.5,2.5)--(0,0,2.5)--cycle),paleyellow,nolight);
draw(surface((0,0,0)--(0,0,2.5)--(2.5,0,2.5)--(2.5,0,0)--cycle),paleyellow,nolight);
draw(surface((0,0,0)--(2.5,0,0)--(2.5,2.5,0)--(0,2.5,0)--cycle),paleyellow,nolight);
draw((2.5,0,0)--(2.5,2.5,0)--(0,2.5,0)--(0,2.5,2.5)--(0,0,2.5)--(2.5,0,2.5)--cycle);
draw(O--3*I, Arrow3(6));
draw(O--3*J, Arrow3(6));
draw(O--3*K, Arrow3(6));
draw(P--(0,1.5,1),dashed);
draw(P--(2,0,1),dashed);
draw(P--(2,1.5,0),dashed);

label("$x$", 3.2*I);
label("$y$", 3.2*J);
label("$z$", 3.2*K);
label("$50$", (2,1.5,1/2), W);
label("$29$", (2,1.5/2,1), S);
label("$41$", (2/2,1.5,1), SE);

dot("$P$", P, N);
dot((0,1.5,1));
dot((2,0,1));
dot((2,1.5,0));
[/asy]

Let $r$ be the radius of the sphere.  Since the sphere is tangent to all three planes, its center is at $(r,r,r).$  Hence,
\[(r - 41)^2 + (r - 29)^2 + (r - 50)^2 = r^2.\]This simplifies to $r^2 - 120r + 2511 = 0,$ which factors as $(r - 27)(r - 93) = 0.$  Hence, the possible values of $r$ are $\boxed{27,93}.$

problem:
There are nine unit triangles in the three rows of this triangle. If you add three more rows to the bottom of this triangle so that each row has 2 more unit triangles than the previous row, how many unit triangles will there be?

