solution:
Let $P$ be the point on the unit circle that is $240^\circ$ counterclockwise from $(1,0)$, and let $D$ be the foot of the altitude from $P$ to the $x$-axis, as shown below.

[asy]
pair A,C,P,O,D;
draw((0,-1.2)--(0,1.2),p=black+1.2bp,Arrows(0.15cm));
draw((-1.2,0)--(1.2,0),p=black+1.2bp,Arrows(0.15cm));
A = (1,0);
O= (0,0);
label("$x$",(1.2,0),SE);
label("$y$",(0,1.2),NE);

P = rotate(240)*A;
D = foot(P,A,-A);
draw(O--P--D);
draw(rightanglemark(O,D,P,2));
draw(Circle(O,1));
label("$O$",O,SE);
label("$P$",P,SW);
//label("$A$",A,SE);
label("$D$",D,N);
[/asy]

Triangle $POD$ is a 30-60-90 triangle, so $DO = \frac{1}{2}$ and $DP = \frac{\sqrt{3}}{2}$.  Therefore, the coordinates of $P$ are $\left(-\frac12,-\frac{\sqrt{3}}{2}\right)$, so $\tan 240^\circ = \frac{\sin240^\circ}{\cos 240^\circ} = \frac{-\sqrt{3}/2}{-1/2} = \boxed{\sqrt{3}}$.

When the degrees of the numerator and denominator are the same in a rational function, the horizontal asymptote is the coefficient of the highest degree in the numerator divided by the coefficient of the highest degree in the denominator. To see this, divide the numerator and denominator by $x^3$ to write the expression as  \[
\frac{4+\frac{2}{x^2}-\frac{4}{x^3}}{3-\frac{2}{x}+\frac{5}{x^2}-\frac{1}{x^3}}
\]As $x\to\infty$ or $x\to-\infty$, the terms involving $x$ approach 0, which means that the whole expression approaches 4/3. Therefore, there is only one horizontal asymptote, and it is at $y=\boxed{\frac43}$.

We see that \begin{align*}
2^{3^2} &= 2^{\left(3^2\right)} \\
&= 2^9 \\
&= \boxed{512}.
\end{align*}

