First, we draw line $CG$. Notice that $\angle CBG$ consists of a $60^\circ$ angle and a $90^\circ$ angle, hence, $\angle CBG = 150^\circ$.

Since $CB=BG$, $\triangle CBG$ is isosceles, with $\angle BCG= (1/2)(180^\circ - 150^\circ) = 15^\circ$.

Finally, to find $\angle GCE$, we subtract $\angle BCG$ from $\angle BCE$ (which measures $60^\circ$ as it is an angle of the triangle.)

Hence our desired answer is $\angle GCE = 60^\circ - 15^\circ = \boxed{45^\circ}$.

We will need to know how much sand Sean has, so we need to find the volumes of each of the two cylindrical containers. If the height of each container is $h$, the old container holds $4^2h\pi = 16h\pi$ cubic centimeters of sand. The new container holds $8^2h\pi = 64h\pi$ cubic centimeters of sand. We can now find how many new containers Sean will need:  \begin{align*}
&12\text{ old containers}\cdot \frac{16h\pi\text{ cm}^3}{1\text{ old container}} \cdot \frac{1 \text{ new container}}{64h\pi\text{ cm}^3} \\
&\qquad = \boxed{3}\text{ new containers}.
\end{align*}

The surface area of a cylinder with radius $r$ and height $h$ is $2\pi r^2+2\pi rh$.  Setting this expression equal to $112\pi$ and substituting $h=2.5r$ gives  \begin{align*}
2\pi r(r+2.5r) &= 112\pi \\
7\pi r^2 &= 112\pi \\
r^2 &= 16 \\
r&=\boxed{4} \text{ cm}.
\end{align*}

problem:
A quarter-circle of radius 3 units is drawn at each of the vertices of a square with sides of 6 units. [asy]

draw((0,0)--(0,1)--(1,1)--(1,0),black);

fill((0,0)--(0,1)--(1,1)--(1,0)--cycle,black);

fill((0.5,1){down}..{left}(0,0.5)--(0,1)--(0.5,1)--cycle,white);

fill((0.5,1){down}..{right}(1,0.5)--(1,1)--(0.5,1)--cycle,white);

fill((0.5,0){up}..{left}(0,0.5)--(0,0)--(0.5,0)--cycle,white);

fill((0.5,0){up}..{right}(1,0.5)--(1,0)--(0.5,0)--cycle,white);

[/asy] The area of the shaded region can be expressed in the form $a-b\pi$ square units, where $a$ and $b$ are both integers. What is the value of $a+b?$

solution:
Let us draw our triangle and altitudes and label our points of interest: [asy]
pair A, B, C, D, E, F;
A = (0, 8);
B = (-6, 0);
C = (6, 0);
D = (0, 0);
E = foot(B,A,C);
F = foot(C,A,B);
draw(A--B--C--cycle);
draw(A--D);
draw(B--E);
draw(C--F);
draw(rightanglemark(B,E,C,10));
draw(rightanglemark(C,F,B,10));
draw(rightanglemark(A,D,C,10));
label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, S);
label("$E$", E, NE);
label("$F$", F, NW);
[/asy] We have made $AB = AC = 10$ and $BC = 12.$ We can notice a few useful things. Since $ABC$ is isosceles, it follows that $AD$ is a median as well as an altitude, which is useful since that means $BD = DC = \frac{1}{2} \cdot BC = 6.$ Now, since $DC = 6$ and $AC = 10,$ we have a $3:4:5$ Pythagorean triple and $AD = 8$. Now we can find the area of $ABC$ by finding $\frac{1}{2} \cdot AD \cdot BC = \frac{1}{2} \cdot 8 \cdot 12 = 48.$

Now, we can find $BE$ by using the area we just found: $\frac{1}{2} \cdot AC \cdot BE = 48.$ Since $AC = 10,$ that means $BE = 9.6$ By symmetry, $CF$ is also $9.6.$ Our answer is: $9.6 + 9.6 + 8 = \boxed{27.2}.$

