dot(O);
dot(M);
dot(J);
dot(T);
[/asy] Line $l$ is drawn to touch the smaller semi-circles at points $S$ and $E$ so that $KS$ and $ME$ are both perpendicular to $l$.  Determine the area of quadrilateral $KSEM$.

solution:
We know that $OA$ and $OB$ are each radii of the semi-circle with center $O$.  Thus, $OA=OB=OC+CB=32+36=68$.  Therefore, $AC=AO+OC=68+32=100$.

The semi-circle with center $K$ has radius $AK=\frac{1}{2}(AC)=\frac{1}{2}(100)=50$.  The radius of the smaller unshaded circle is $MB=\frac{1}{2}(CB)=\frac{1}{2}(36)=18$.


Construct line segments $KS$ and $ME$ perpendicular to line $l$.  Position point $Q$ on $KS$ so that $MQ$ is perpendicular to $KS$, as shown.  In quadrilateral $MQSE$, $\angle MQS=\angle QSE=\angle SEM=90^\circ$.  Hence, quadrilateral $MQSE$ is a rectangle.  [asy]
pair A, K, O, C, M, B, X, Y, Z, J, T, Q;
O=(0,0);
C=(32,0);
M=(50,0);
B=(68,0);
A=(-68,0);
K=(A+C)/2;
X=(0,68);
Y=(-18,50);
Z=(50,18);
J=(7,43.3);
T=(59,15.6);
Q=(.64(J-K) + K);
path nom, bigc, middlec, smallc;
nom=A--B--(100,100)--(-100,100)--cycle;
bigc=A..X..B--cycle;
middlec=A..Y..C--cycle;
smallc=C..Z..B--cycle;
fill(bigc, gray(.5));
fill(middlec, white);
fill(smallc, white);
draw(smallc);
draw(middlec);
draw(bigc);
draw(A--B);
draw(K--J);
draw(T--M--Q);
label("Q", Q, S);
label("A", A, S);
label("K", K, S);
label("O", O, S);
label("M", M, S);
label("C", C, S);
label("B", B, S);
label("S", J, SW);
label("E", T, SW);
label("$l$", (.9(J-T)+J), NW);
draw((.9(J-T)+J)--(.5(T-J)+T));
dot(K);
dot(O);
dot(M);
dot(J);
dot(T);
[/asy] The larger unshaded semi-circle has radius 50, so $KC=KS=50$. The smaller unshaded semi-circle has radius 18, so $ME=MC=MB=18$. Thus, $MK=MC+KC=18+50=68$. The area of quadrilateral $KSEM$ is the sum of the areas of rectangle $MQSE$ and $\triangle MKQ$.  Since $QS=ME=18$, then $KQ=KS-QS=50-18=32$.  Using the Pythagorean Theorem in $\triangle MKQ$, \[MK^2=KQ^2+QM^2\]or \[68^2=32^2+QM^2\]or \[QM=\sqrt{68^2-32^2}=60\](since $QM>0$).  The area of $\triangle MKQ$ is $\frac{1}{2}(KQ)(QM)=\frac{1}{2}(32)(60)=960$.  The area of rectangle $MQSE$ is $(QM)(QS)=(60)(18)=1080$.  Thus, the area of quadrilateral $KSEM$ is $960+1080=\boxed{2040}$.

We have that
\begin{align*}
z_1 \overline{z}_1 &= |z_1|^2, \\
z_2 \overline{z}_2 &= |z_2|^2, \\
z_3 \overline{z}_3 &= |z_3|^2.
\end{align*}Likewise,
\begin{align*}
&|z_1 - z_2|^2 + |z_1 - z_3|^2 + |z_2 - z_3|^2 \\
&= (z_1 - z_2)(\overline{z_1 - z_2}) + (z_1 - z_3)(\overline{z_1 - z_3}) + (z_2 - z_3)(\overline{z_2 - z_3}) \\
&= (z_1 - z_2)(\overline{z}_1 - \overline{z}_2) + (z_1 - z_3)(\overline{z}_1 - \overline{z}_3) + (z_2 - z_3)(\overline{z}_2 - \overline{z}_3) \\
&= z_1 \overline{z}_1 - z_1 \overline{z}_2 - \overline{z}_1 z_2 + z_2 \overline{z}_2 + z_1 \overline{z}_1 - z_1 \overline{z}_3 - \overline{z}_1 z_3 + z_1 \overline{z}_3 + z_2 \overline{z}_3 - z_2 \overline{z}_3 - \overline{z}_2 z_3 + z_2 \overline{z}_3 \\
&= 2|z_1|^2 + 2|z_2|^2 + 2|z_3|^2 - (z_1 \overline{z}_2 + \overline{z}_1 z_2 + z_1 \overline{z}_3 + \overline{z}_1 z_3 + z_2 \overline{z}_3 + \overline{z}_2 z_3).
\end{align*}Now,
\begin{align*}
|z_1 + z_2 + z_3|^2 &= (z_1 + z_2 + z_3)(\overline{z_1 + z_2 + z_3}) \\
&= (z_1 + z_2 + z_3)(\overline{z}_1 + \overline{z}_2 + \overline{z}_3) \\
&= z_1 \overline{z}_1 + z_1 \overline{z}_2 + z_1 \overline{z}_3 + z_2 \overline{z}_1 + z_2 \overline{z}_2 + z_2 \overline{z}_3 + z_3 \overline{z}_1 + z_3 \overline{z}_2 + z_3 \overline{z}_3 \\
&= |z_1|^2 + |z_2|^2 + |z_3|^2 + (z_1 \overline{z}_2 + \overline{z}_1 z_2 + z_1 \overline{z}_3 + \overline{z}_1 z_3 + z_2 \overline{z}_3 + \overline{z}_2 z_3).
\end{align*}Adding these two equations, we get
\[|z_1 - z_2|^2 + |z_1 - z_3|^2 + |z_2 - z_3|^2 + |z_1 + z_2 + z_3|^2 = 3|z_1|^2 + 3|z_2|^2 + 3|z_3|^2.\]Therefore,
\begin{align*}
|z_1 - z_2|^2 + |z_1 - z_3|^2 + |z_2 - z_3|^2 &= 3|z_1|^2 + 3|z_2|^2 + 3|z_3|^2 - |z_1 + z_2 + z_3|^2 \\
&\le 3 \cdot 2^2 + 3 \cdot 3^2 + 3 \cdot 4^2 \\
&= 87.
\end{align*}For equality to occur, we must have $z_1 + z_2 + z_3 = 0.$  Without loss of generality, we can assume that $z_1 = 2.$  Then $z_2 + z_3 = -2.$  Taking the conjugate, we get
\[\overline{z}_2 + \overline{z}_3 = -2.\]Since $|z_2| = 3,$ $\overline{z}_2 = \frac{9}{z_2}.$  Since $|z_3| = 4,$ $\overline{z}_3 = \frac{16}{z_3},$ so
\[\frac{9}{z_2} + \frac{16}{z_3} = -2.\]Then $9z_3 + 16z_2 = -2z_2 z_3.$  Substituting $z_3 = -z_2 - 2,$ we get
\[9(-z_2 - 2) + 16z_2 = -2z_2 (-z_2 - 2).\]This simplifies to $2z_2^2 - 3z_2 + 18 = 0.$  By the quadratic formula,
\[z_2 = \frac{3 \pm 3i \sqrt{15}}{4}.\]If we take $z_2 = \frac{3 + 3i \sqrt{15}}{4},$ then $z_3 = -\frac{11 + 3i \sqrt{15}}{4}.$  This example shows that equality is possible, so the maximum value is $\boxed{87}.$

[asy]
unitsize(1 cm);

pair zone, ztwo, zthree;

zone = (2,0);
ztwo = (3/4,3*sqrt(15)/4);
zthree = (-11/4,-3*sqrt(15)/4);

draw(Circle((0,0),2),red);
draw(Circle((0,0),3),green);
draw(Circle((0,0),4),blue);
draw(zone--ztwo--zthree--cycle);

dot("$z_1$", zone, E);
dot("$z_2$", ztwo, N);
dot("$z_3$", zthree, SW);
[/asy]

Alternative: For equality to occur, we must have $z_1 + z_2 + z_3 = 0.$  Without loss of generality, we can assume that $z_1 = 2.$  Then $z_2 + z_3 = -2.$  Let $z_2 = x + iy$ so that $z_3 = -x - 2 - iy,$ where $x$ and $y$ are real numbers.  We need
\begin{align*}
  |z_2|^2 = x^2 + y^2 &= 9 \\
  |z_3|^2 = (x + 2)^2 + y^2 &= 16.
\end{align*}Subtracting the first equation from the second, we get $4x + 4 = 7,$ or $x = \dfrac34.$  One solution is $z_2 = \dfrac34 + i\dfrac{3\sqrt{15}}{4}$ and $z_3 = -\dfrac{11}4 + i\dfrac{3\sqrt{15}}{4}.$  This example shows that equality is possible, so the maximum value is $\boxed{87}.$

There are many ways to draw the diagram; one possibility is shown below.  We know that $\angle BAC \cong \angle CAD\cong \angle BCA$ since $\overline{AC}$ bisects $\angle BAD$ and $\overline{AD} || \overline{BC}$.  Therefore $\triangle BAC$ is isosceles.  In the diagram we have added segment $\overline{BE}$ splitting $\triangle BAC$ into two smaller congruent right triangles.  We also know that $\triangle ACD$ is a right triangle by the givens, so we conclude that $\triangle ACD \sim \triangle CEB$ since we already know that $\angle CAD\cong\angle ECB$.  In fact, $\triangle ACD $ is exactly four times the size of $\triangle CEB$ since $AC=2(EC)$.  If we let $[\triangle CEB]=K$, then $[\triangle AEB]=K$ while $[\triangle ACD]=4K$.  Thus $6K=42$, so $K=7$ and $[\triangle ACD]=4K=\boxed{28}$.

