Since $\angle ACM = 40^\circ$, $\angle ACP = 140^\circ$, so $\angle ABP = 40^\circ$.  Then $\angle ABC = \angle ABP - \angle CBP = 40^
\circ - 10^\circ = 30^\circ$.

Since $CA = CB$, triangle $ABC$ is isosceles, and $\angle BAC = \angle ABC = 30^\circ$.  Then $\angle BAP = \angle BAC - \angle CAP = 30^\circ - 10^\circ = 20^\circ$.  Hence, $\angle BCP = \angle BAP = \boxed{20^\circ}$.

Since $\angle ABC = 90^\circ$ and $\overline{BM}$ bisects $\angle ABC$, we have $\angle ABM = 45^\circ$, so $\cos \angle ABM = \cos 45^\circ = \boxed{\frac{\sqrt{2}}{2}}$.

