A regular hexagon of side length 1 is placed vertically along one of its edges on a flat surface.  A particle is fired from the surface and passes through four of the vertices of the hexagon, as shown below, tracing the arc of a parabola.  If the particle starts at $A$ and ends at $B,$ then find the length $AB.$

[asy]
unitsize(1.5 cm);

real func (real x) {
  return(-2/sqrt(3)*x^2 + 7/(2*sqrt(3)));
}

pair A, B;

A = (-sqrt(7)/2,0);
B = (sqrt(7)/2,0);

draw(shift((0,sqrt(3)/2))*(dir(240)--dir(180)--dir(120)--dir(60)--dir(0)--dir(-60)));
draw((-2,0)--(2,0));
draw(graph(func,-sqrt(7)/2,sqrt(7)/2),red);

label("$A$", A, S);
label("$B$", B, S);
[/asy]

solution:
We place the diagram in the coordinate plane so that the origin coincides with the midpoint of the bottom edge of the hexagon.  Using the fact that the hexagon has side length 1, we can determine its vertices.

[asy]
unitsize(1.5 cm);

real func (real x) {
  return(-2/sqrt(3)*x^2 + 7/(2*sqrt(3)));
}

pair A, B;

A = (-sqrt(7)/2,0);
B = (sqrt(7)/2,0);

draw(shift((0,sqrt(3)/2))*(dir(240)--dir(180)--dir(120)--dir(60)--dir(0)--dir(-60)));
draw((-2,0)--(2,0));
draw(graph(func,-sqrt(7)/2,sqrt(7)/2),red);

label("$A$", A, S);
label("$B$", B, S);

dot("$(0,0)$", (0,0), S);
dot("$(1,\frac{\sqrt{3}}{2})$", dir(0) + (0,sqrt(3)/2), E);
dot("$(\frac{1}{2},\sqrt{3})$", dir(60) + (0,sqrt(3)/2), NE);
dot("$(-\frac{1}{2},\sqrt{3})$", dir(120) + (0,sqrt(3)/2), NW);
dot("$(-1,\frac{\sqrt{3}}{2})$", dir(180) + (0,sqrt(3)/2), W);
[/asy]

By symmetry, the equation of the trajectory is of the form $y = ax^2 + c.$  Then
\begin{align*}
\frac{a}{4} + c &= \sqrt{3}, \\
a + c &= \frac{\sqrt{3}}{2}.
\end{align*}Solving, we find $a = -\frac{2}{\sqrt{3}}$ and $c = \frac{7}{2 \sqrt{3}},$ so the equation of the trajectory is
\[y = -\frac{2}{\sqrt{3}} x^2 + \frac{7}{2 \sqrt{3}}.\]Setting $y = 0,$ we get
\[-\frac{2}{\sqrt{3}} x^2 + \frac{7}{2 \sqrt{3}} = 0.\]Then $x^2 = \frac{7}{4},$ so $x = \pm \frac{\sqrt{7}}{2}.$  Thus, the distance $AB$ is $\frac{\sqrt{7}}{2} - \left( -\frac{\sqrt{7}}{2} \right) = \boxed{\sqrt{7}}.$

