What is the degree measure of the smallest angle in triangle $PQS$?

solution:
Join $PQ$, $PR$, $PS$, $RQ$, and $RS$. Since the circles with center $Q$, $R$ and $S$ are all tangent to $BC$, then $QR$ and $RS$ are each parallel to $BC$ (as the centres $Q$, $R$ and $S$ are each 1 unit above $BC$). This tells us that $QS$ passes through $R$. When the centers of tangent circles are joined, the line segments formed pass through the associated point of tangency, and so have lengths equal to the sum of the radii of those circles. Therefore, $QR=RS=PR=PS=1+1=2$.

[asy]
size(200);
pair P, Q, R, S;
Q=(0,0);
R=(2,0);
S=(4,0);
P=(3,1.732);
label("Q", Q, SW);
label("R", R, dir(270));
label("S", S, SE);
label("P", P, N);
draw(circle(Q,1), dashed);
draw(circle(P,1), dashed);
draw(circle(R,1), dashed);
draw(circle(S,1), dashed);
draw(P--Q--S--P--R);
[/asy]

Since $PR=PS=RS$, we know $\triangle PRS$ is equilateral, so $\angle PSR=\angle PRS=60^\circ$.  Since $\angle PRS=60^\circ$ and $QRS$ is a straight line, we have $\angle QRP=180^\circ-60^\circ=120^\circ$. Since $QR=RP$, we know $\triangle QRP$ is isosceles, so $$\angle PQR = \frac{1}{2}(180^\circ-120^\circ)= 30^\circ.$$Since $\angle PQS=30^\circ$ and $\angle PSQ=60^\circ$, we have $\angle QPS = 180^\circ - 30^\circ - 60^\circ = 90^\circ$, so $\triangle PQS$ is a $30^\circ$-$60^\circ$-$90^\circ$ triangle. Thus, the answer is $\boxed{30^\circ}$.

Plugging $x=2$ into the expression for $f(x)$, we find $f(2)=c(2^3)-9(2)+3=8c-18+3=8c-15$. Since we know that $f(2)=9$, \begin{align*} f(2)&= 9
\\\Rightarrow\qquad8c-15&=9
\\\Rightarrow\qquad8c&=24
\\\Rightarrow\qquad c&=\boxed{3}
\end{align*}

Here's a labelled picture of our square, with the vertices connected to the origin:
[asy]
import TrigMacros; 
size(180); 

pair O, A, B, C;

rr_cartesian_axes(-2, 8, -5, 7, complexplane = true, usegrid = false); 
O = (0,0); 
A = (3, -1); 
B = scale(sqrt(2))*rotate(45)*A; 
C = rotate(90)*A; 

draw(A--B--C--O--cycle); 
draw(O--B); 

dot("$a$", A, S); 
dot("$b$", B, E); 
dot("$c$", C, N); 
dot("$0$", O, SW); 
[/asy]

We know $b$ is a rotation of $a$ by $\pi/4$ around the origin, scaled by a factor of $\sqrt{2}$. That means that $b = \sqrt{2}e^{\pi i/4} a$, which becomes
\begin{align*} 
b &= \sqrt{2}(\cos (\pi/4) + i \sin(\pi/4))a \\
    &= \sqrt{2}\left( \dfrac{\sqrt{2}}{2} + \dfrac{\sqrt{2}}{2} i\right)a \\
    &= (1+i)a.
\end{align*}Therefore, $\frac{b}{a} = 1+i.$

Similarly, $c$ is a rotation of $b$ by $\pi/4$ around the origin, scaled by a factor of $\frac{1}{\sqrt{2}},$  That means $c = \frac{e^{\pi i/4}}{\sqrt{2}} b,$ which becomes
\[c = \frac{\sqrt{2}/2 + \sqrt{2}/2 \cdot i}{\sqrt{2}} b = \frac{1 + i}{2} b.\]Therefore, $\frac{c}{b} = \frac{1 + i}{2}.$

Then
\[\frac{ac + b^2}{ab} = \frac{c}{b} + \frac{b}{a} = \frac{1 + i}{2} + 1 + i = \boxed{\frac{3}{2} + \frac{3}{2} i}.\]

$S$ looks like a nonagon with slightly rounded corners.  We draw adjacent sides of the nonagon and look at the boundary of $S$:

[asy]
size(200);
draw((-7.66,-6.43)--(0,0)--(10,0)--(17.66,-6.43));
draw((0,5)--(10,5),blue); draw((13.21,3.83)--(20.87,-2.60),blue);
draw(Arc((10,0),5,50,90),red); draw(Arc((0,0),5,90,130),red);
draw((10,0)--(10,5),dashed); draw((0,0)--(0,5),dashed);
draw((10,0)--(13.21,3.83),dashed);
label("2",(5,0),S); label("1",(10,2.5),W);
draw((-3.21,3.83)--(-10.87,-2.60),blue);
draw((-3.21,3.83)--(0,0),dashed);
[/asy] We can split the portion of $S$ that is outside the nonagon into 9 rectangles and 9 circle sectors, thereby breaking the perimeter of $S$ into alternating straight lines (colored blue above) and curved arcs (colored red above).  The perimeter of $S$ is comprised of nine blue lines and nine red arcs.

Each rectangle has side lengths 1 and 2, so each blue line is 2 units long and the total length of the blue portion of the perimeter is $2\cdot 9 = 18$ units.

Around each vertex of the nonagon, an interior angle, two right angles, and an angle of the circular sector add up to 360 degrees.  The angles inside a nonagon each measure $180(9-2)/9=140$ degrees.  Thus, each circular sector angle measures $360-90-90-140=40$ degrees.  Each sector has radius 1 and arc length $\frac{40^\circ}{360^\circ}(2)(\pi)(1)=\frac{1}{9}(2\pi)$, so nine of these sectors have total arc length $2\pi$.  Thus the total length of the red portion of the perimeter is $2\pi$ units.  (Notice that this is equal to the perimeter of a circle with radius 1, which is what the nine sectors add up to.)

Finally, the perimeter of $S$ is $\boxed{18+2\pi}$ units.

problem:
Assume that the length of Earth's equator is exactly 25,100 miles and that the Earth is a perfect sphere. The town of Lena, Wisconsin, is at $45^{\circ}$ North Latitude, exactly halfway between the equator and the North Pole. What is the number of miles in the circumference of the circle on Earth parallel to the equator and through Lena, Wisconsin? Express your answer to the nearest hundred miles.  (You may use a calculator for this problem.)

[asy]
size(4.5cm,4.5cm);
draw(unitcircle);
draw((-1,0)..(0,-0.2)..(1,0));
draw((-0.95,0.05)..(0,0.2)..(0.97,0.05),1pt+dotted);
draw((-0.7,0.7)..(0,0.6)..(0.7,0.7));
draw((-0.65,0.75)..(0,0.8)..(0.66,0.75),1pt+dotted);
dot((0,0));
draw((0,0)--(1,0));
draw((0,0)--(0.7,0.7));
dot((0.7,0.7));
dot((0,0.72));
label("Lena",(0.7,0.7),ENE);
label("$45^\circ$",shift(0.3,0.1)*(0,0));
[/asy]

solution:
Let Earth's radius be $r$.  Since the equator measures 25100 miles, we have $2\pi r = 25100 \Rightarrow r = \frac{12550}{\pi}$.

[asy]
defaultpen(linewidth(.7pt)+fontsize(10pt));
size(4.5cm,4.5cm);
draw(unitcircle);
draw((-1,0)..(0,-0.2)..(1,0));
draw((-0.95,0.05)..(0,0.2)..(0.97,0.05),1pt+dotted);
draw((-0.7,0.7)..(0,0.6)..(0.7,0.7));
draw((-0.65,0.75)..(0,0.8)..(0.66,0.75),1pt+dotted);
dot((0,0));
draw((0,0)--(1,0));
draw((0,0)--(0.7,0.7));
dot((0.7,0.7));
dot((0,0.72));
draw((.7,.7)--(0,.72)--(0,0),dashed);
label("$\frac{r}{\sqrt{2}}$",((.7,.7)--(0,.72)),N); label("$\frac{r}{\sqrt{2}}$",((0,0)--(0,.72)),W);
label("$r$",((0,0)--(1,0)),S); label("$r$",((0,0)--(0.7,.7)),SE);
label("$A$",(0,0),SW); label("$B$",(0,.7),NW);
label("$L$",(0.7,0.7),ENE);
label("$45^\circ$",shift(0.3,0.1)*(0,0));
[/asy]

Let Earth's center be $A$, let the center of the circle that passes through Lena be $B$, and let Lena be $L$.  Because $\overline{BL}$ is parallel to the equator and Lena is at $45^\circ$ North Latitude, $\triangle ABL$ is a 45-45-90 triangle.  Thus, $BL=AB=\frac{r}{\sqrt{2}}$.

The number of miles in the circumference of the circle parallel to the equator and through Lena is $2\pi \cdot BL = 2\pi \frac{r}{\sqrt{2}} = \frac{25100}{\sqrt{2}} \approx 17748$ miles.  To the nearest hundred miles, this value is $\boxed{17700}$ miles.

problem:
Let $ABCD$ be a parallelogram. We have that $M$ is the midpoint of $AB$ and $N$ is the midpoint of $BC.$ The segments $DM$ and $DN$ intersect $AC$ at $P$ and $Q$, respectively. If $AC = 15,$ what is $QA$? [asy]
pair A, B, C, D, pM, pN, O, P, Q;
A = (25, 0) * dir(-20);
B = (15, 0) * dir(60);
C = (25, 0) * dir(160);
D = (15, 0) * dir(-120);
pM = 0.5 * A + 0.5 * B;
pN = 0.5 * B + 0.5 * C;
O = 0.25 * A + 0.25 * B + 0.25 * C + 0.25 * D;
P = 0.33 * C + 0.67 * A;
Q = 0.67 * C + 0.33 * A;
draw(A--B--C--D--cycle);
draw(A--C);
draw(pM--D);
draw(pN--D);
label("$A$", A, S);
label("$B$", B, NE);
label("$C$", C, NW);
label("$D$", D, S);
label("$M$", pM, NE);
label("$N$", pN, NW);
label("$P$", P, N);
label("$Q$", Q, NE);
[/asy]

solution:
Solution 1: The segment $BD$ begs to be drawn, so we start there: [asy]
pair A, B, C, D, pM, pN, O, P, Q;
A = (25, 0) * dir(-20);
B = (15, 0) * dir(60);
C = (25, 0) * dir(160);
D = (15, 0) * dir(-120);
pM = 0.5 * A + 0.5 * B;
pN = 0.5 * B + 0.5 * C;
O = 0.25 * A + 0.25 * B + 0.25 * C + 0.25 * D;
P = 0.33 * C + 0.67 * A;
Q = 0.67 * C + 0.33 * A;
draw(A--B--C--D--cycle);
draw(A--C);
draw(B--D);
draw(pM--D);
draw(pN--D);
label("$A$", A, S);
label("$B$", B, NE);
label("$C$", C, NW);
label("$D$", D, S);
label("$M$", pM, NE);
label("$N$", pN, NW);
label("$P$", P, N);
label("$Q$", Q, NE);
[/asy] We can clearly see that now we have triangles $ABD$ and $CBD,$ and $MD,$ $ND,$ and $AC$ are medians to one or more of the triangles. That means that $P$ and $Q$ are the centroids of triangles $ABD$ and $CBD,$ respectively. Since $AC = 15,$ that means $CQ = 5,$ since the median from $C$ to $BD$ is half the length of $AC,$ or $7.5,$ and $CQ$ must be $\frac{2}{3}$ of that, or $5.$ Therefore, $QA = AC - CQ = 15 - 5 = \boxed{10}.$

Solution 2: Since $ABCD$ is a parallelogram, $\overline{AD}$ and $\overline{BC}$ are parallel with $\overline{AC}$ and $\overline{DN}$ as transversals.  So $\angle DAQ = \angle NCQ$ and $\angle ADQ = \angle CNQ$, and so $\triangle ADQ$ and $\triangle CNQ$ are similar by AA similarity.

Also, we know opposite sides of a parallelogram are congruent, so $AD = BC$.  Since $N$ is a midpoint of $\overline{BC}$, we have $CN = \dfrac{AD}2$.  By similar triangles, \[ \dfrac{AQ}{CQ} = \dfrac{AD}{CN} = 2, \]so $AQ = 2CQ.$  Since $AQ + CQ = AC = 15$, we have $CQ = 5$ and $AQ = \boxed{10}.$

Since $33^{-1} \equiv 77 \pmod{508}$, \begin{align*}
11^{-1} &\equiv (33 \cdot 3^{-1})^{-1} \\
&\equiv 33^{-1} \cdot 3 \\
&\equiv 77 \cdot 3 \\
&\equiv \boxed{231} \pmod{508}.
\end{align*}

By product-to-sum,
\begin{align*}
\frac{1}{2 \sin 10^\circ} - 2 \sin 70^\circ &= \frac{1 - 4 \sin 10^\circ \sin 70^\circ}{2 \sin 10^\circ} \\
&= \frac{1 - 2 (\cos 60^\circ - \cos 80^\circ)}{2 \sin 10^\circ} \\
&= \frac{2 \cos 80^\circ}{2 \sin 10^\circ} = \boxed{1}.
\end{align*}

