Then
\begin{align*}
AQ^2 &= \|\mathbf{a} - \mathbf{q}\|^2 \\
&= \left\| \mathbf{a} - \frac{1}{4} \mathbf{a} - \frac{1}{2} \mathbf{b} - \frac{1}{4} \mathbf{c} \right\|^2 \\
&= \left\| \frac{3}{4} \mathbf{a} - \frac{1}{2} \mathbf{b} - \frac{1}{4} \mathbf{c} \right\|^2 \\
&= \frac{1}{16} \|3 \mathbf{a} - 2 \mathbf{b} - \mathbf{c}\|^2 \\
&= \frac{1}{16} (3 \mathbf{a} - 2 \mathbf{b} - \mathbf{c}) \cdot (3 \mathbf{a} - 2 \mathbf{b} - \mathbf{c}) \\
&= \frac{1}{16} (9 \mathbf{a} \cdot \mathbf{a} + 4 \mathbf{b} \cdot \mathbf{b} + \mathbf{c} \cdot \mathbf{c} - 12 \mathbf{a} \cdot \mathbf{b} - 6 \mathbf{a} \cdot \mathbf{c} + 4 \mathbf{b} \cdot \mathbf{c}).
\end{align*}Similarly,
\begin{align*}
AR^2 &= \frac{1}{16} (9 \mathbf{a} \cdot \mathbf{a} + \mathbf{b} \cdot \mathbf{b} + 4 \mathbf{c} \cdot \mathbf{c} - 6 \mathbf{a} \cdot \mathbf{b} - 12 \mathbf{a} \cdot \mathbf{c} + 4 \mathbf{b} \cdot \mathbf{c}), \\
BP^2 &= \frac{1}{16} (4 \mathbf{a} \cdot \mathbf{a} + 9 \mathbf{b} \cdot \mathbf{b} + \mathbf{c} \cdot \mathbf{c} - 12 \mathbf{a} \cdot \mathbf{b} + 4 \mathbf{a} \cdot \mathbf{c} - 6 \mathbf{b} \cdot \mathbf{c}), \\
BR^2 &= \frac{1}{16} (\mathbf{a} \cdot \mathbf{a} + 9 \mathbf{b} \cdot \mathbf{b} + 4 \mathbf{c} \cdot \mathbf{c} - 6 \mathbf{a} \cdot \mathbf{b} + 4 \mathbf{a} \cdot \mathbf{c} - 12 \mathbf{b} \cdot \mathbf{c}), \\
CP^2 &= \frac{1}{16} (4 \mathbf{a} \cdot \mathbf{a} + \mathbf{b} \cdot \mathbf{b} + 9 \mathbf{c} \cdot \mathbf{c} + 4 \mathbf{a} \cdot \mathbf{b} - 12 \mathbf{a} \cdot \mathbf{c} - 6 \mathbf{b} \cdot \mathbf{c}), \\
CQ^2 &= \frac{1}{16} (\mathbf{a} \cdot \mathbf{a} + 4 \mathbf{b} \cdot \mathbf{b} + 9 \mathbf{c} \cdot \mathbf{c} + 4 \mathbf{a} \cdot \mathbf{b} - 6 \mathbf{a} \cdot \mathbf{c} - 4 \mathbf{b} \cdot \mathbf{c}), \\
AB^2 &= \mathbf{a} \cdot \mathbf{a} - 2 \mathbf{a} \cdot \mathbf{b} + \mathbf{b} \cdot \mathbf{b}, \\
AC^2 &= \mathbf{a} \cdot \mathbf{a} - 2 \mathbf{a} \cdot \mathbf{c} + \mathbf{c} \cdot \mathbf{c}, \\
BC^2 &= \mathbf{b} \cdot \mathbf{b} - 2 \mathbf{b} \cdot \mathbf{c} + \mathbf{c} \cdot \mathbf{c}.
\end{align*}Hence,
\begin{align*}
\frac{AQ^2 + AR^ 2+ BP^2 + BR^2 + CP^2 + CQ^2}{AB^2 + AC^2 + BC^2} &= \frac{\frac{1}{16} (28 \mathbf{a} \cdot \mathbf{a} + 28 \mathbf{b} \cdot \mathbf{b} + 28 \mathbf{c} \cdot \mathbf{c} - 28 \mathbf{a} \cdot \mathbf{b} - 28 \mathbf{a} \cdot \mathbf{c} - 28 \mathbf{b} \cdot \mathbf{c})}{2 \mathbf{a} \cdot \mathbf{a} + 2 \mathbf{b} \cdot \mathbf{b} + 2 \mathbf{c} \cdot \mathbf{c} - 2 \mathbf{a} \cdot \mathbf{b} - 2 \mathbf{a} \cdot \mathbf{c} - 2 \mathbf{b} \cdot \mathbf{c}} \\
&= \boxed{\frac{7}{8}}.
\end{align*}

The midpoints of the diagonals of a square coincide, so the midpoint of the line segment joining (7,9) and (10,2) is the same as the midpoint of the line segment joining the other two vertices of the square.  The average of the $y$-coordinates of (7,9) and (10,2) is the $y$-coordinate of their midpoint, which in turn is also equal to the average of the $y$-coordinates of the missing vertices.  Therefore, the average of the $y$-coordinates of (7,9) and (10,2) is equal to the average of the $y$-coordinates of the two missing vertices.  Since the sum is twice the average, the sum of the $y$-coordinates of the missing vertices is the same as that of the given vertices: $9+2=\boxed{11}$.

